import styled from "styled-components";
import React from "react";

const Viewers = (props) => {
  return (
    <Container>
      <div>1</div>
      <div>2</div>
      <div>3</div>
      <div>4</div>
      <div>5</div>
    </Container>
  );
};

const Container = styled.div`
  display: grid;
  margin-top: 30px;
  padding: 30px 0 26px;
  gap: 25px;
  grid-gap: 25px;
  grid-template-columns: repeat(5, minmax(0, 1fr));

  @media (max-width: 768px);
`;

export default Viewers;
